description:
Nhà có diện tích đất 48m2, xây 3 tầng, cầu thang giữa nhà; 
👉Tầng 1🌹công năng gồm chỗ để xe, khách, bếp, 1 nhà vệ sinh; 
👉Tầng 2 🌹gồm 2 phòng ngủ, 1 nhà vệ sinh; 
👉Tầng 3 🌹gồm phòng ngủ, thờ, sân phơi; Mái lợp tôn chống nóng;
Ngõ vào nhà đường thẳng tắp ô tô tránh xe máy, cách đường ô tô tránh nhau và là trục chính của làng Phú Diễn 100m, vài bước ra đến chợ.
Cách trường mầm non và cấp 1 cấp 2 Phú diễn A 200m. 
Rất thuận tiện cho con học liên cấp từ mầm non lên hết cấp 3. 
Cách trường đại học tài nguyên môi trường 500m.  
Gần chợ mới và công an phường phú diễn 
Khu dân cư phát triển an ninh tốt. 
Nhà chính chủ tự xây lên chắc chắn công năng hợp lý 
Sổ đỏ sẵn sàng giao dịch
